  'admin+splash_intro_value' => '<style> h1 { color:#CF3513;} h5 {color:#CF3513; font-size:13px;} h5 a{ color:#CF3513; font-weight:bold; text-decoration: none;} a:hover{ text-decoration: underline; h2 {color:#666666;} h4 {color:#999999;} #smfb { padding:10px;} .att { font-weight:bold;} .att a:hover{ font-weight:bold;} </style> <div id="smfb"> <a href="http://www.socialmotori.com" title="Social Motori" target="_blank"><img src="http://www.socialmotori.com/immagini/logo1.jpg" title="Social Motori" /></a> </h2> <h1>Sei un appassionato di motori... unisciti alla nostra community!</h1> <h4>Registrati crea il tuo profilo e condividi la tua passione per auto, moto, barche e altri veicoli con Social Motori!</h4> <h5><img src="http://www.socialmotori.com/immagini/ic_key.png" />  <a href="http://www.socialmotori.com" target="_blank"><span class="att">Registrati</span></a> o collegati con Facebook  <img src="http://www.socialmotori.com/immagini/ic_right_arrow.png"/> Crea il tuo profilo</h5> <h5><img src="http://www.socialmotori.com/immagini/ic_add.png" /> Invita i tuoi amici con Facebook e Google</h5> <h5><img src="http://www.socialmotori.com/immagini/ic_picture.png" />  <a href="http://www.socialmotori.com/photo" target="_blank">Crea i tuoi album fotografici</a></h5> <h5><img src="http://www.socialmotori.com/immagini/ic_video.png" />  <a href="http://www.socialmotori.com/video" target="_blank">Carica i tuoi video</a></h5> <h5><img src="http://www.socialmotori.com/immagini/ic_link.png" /> <a href="http://www.socialmotori.com/links" target="_blank">Inserisci i tuoi link preferiti</a></h5> <h5><img src="http://www.socialmotori.com/immagini/ic_forum.png" /> <a href="http://www.socialmotori.com/groups" target="_blank">Crea i tuoi gruppi</a></h5> <h5><img src="http://www.socialmotori.com/immagini/ic_calendar.png" /> <a href="http://www.socialmotori.com/events" target="_blank">Crea i tuoi eventi</a></h5> <p align="center">Aiutaci a creare la più grande community di motori!</p> </div>',
