  'admin+ads_delete_button_label' => '',
  'base+local_page_content_page_81959573' => '<p class="ow_smallmargin"> Thank you for visiting our website. This privacy policy tells you how we use personal information collected at this website. Please read this privacy policy before using the website or submitting any personal information. By using the website, you are accepting the practices described in this privacy policy. These practices may be changed, but any changes will be posted and will only apply to activities and information on a going forward, not retroactive basis. You are encouraged to review the privacy policy whenever you visit the site to keep track of the policy changes and make sure that you understand how any personal information you provide will be used. </p> <p class="ow_stdmargin"> Note: the privacy practices set forth in this privacy policy are for this website only. If you link to other websites, please review the privacy policies posted at those websites. </p> <h2 class="ow_smallmargin">Collection of Information</h2> <p class="ow_stdmargin"> We collect personally identifiable information, like names, email addresses, etc., when voluntarily submitted by our visitors. This information is only used to fulfill your specific request and to sign you up for our service mailing list, unless you give us permission to use it in other manners. </p> <h2 class="ow_smallmargin">Cookie/Tracking Technology</h2> <p class="ow_stdmargin"> This website may use cookie and tracking technology depending on the features offered. Cookie and tracking technology are useful for gathering information such as browser type and operating system, tracking the number of visitors to the website, and understanding how visitors use the website. Cookies can also help customize the website for visitors. Personal information cannot be collected via cookies and other tracking technology, however, if you previously provided personally identifiable information, cookies may be tied to such information. Aggregate cookie and tracking information may be shared with third parties. </p> <h2 class="ow_smallmargin">Distribution of Information</h2> <p class="ow_stdmargin"> We may share information with governmental agencies or other companies assisting us in fraud prevention or investigation. We may do so when: (1) permitted or required by law; or, (2) trying to protect against or prevent actual or potential fraud or unauthorized transactions; or, (3) investigating fraud which has already taken place. The information is not provided to these companies for marketing purposes. </p> <h2 class="ow_smallmargin">Commitment to Data Security</h2> <p class="ow_stdmargin"> Your personally identifiable information is kept secure. Only authorized employees, agents and contractors (who have agreed to keep information secure and confidential) have access to this information. All emails and newsletters from this website allow you to opt out of further mailings. </p> <h2 class="ow_smallmargin">Privacy Contact Information</h2> <p class="ow_stdmargin"> If you have any questions, concerns, or comments about our privacy policy you may contact us using means provided on this website. </p> <p> We reserve the right to make changes to this policy. Any changes to this policy will be posted. </p>',
