  'ningimport+import_btn_label' => 'Importazione',
  'ningimport+log_description' => '<p> È soprattutto il risultato della vostra importazione. Ora è possibile andare <a href="http://baksmaker.com/fulfill/admin/users">sfogliare tutti i membri</a>. </p> <p> <b>IMPORTANTE:</b> Si dovrebbe fare mass mailing (invio di messaggi broadcast) a tutti gli utenti del tuo sito Ning per far loro conoscere il movimento e il nuovo URL del vostro sito. </p> <p> Per questo, </p> <p class="ow_highbox" align="center" style="font-weight:bold"> Vai al tuo social network Ning -> Gestisci -> Broadcast Message</p> <p> <b>IMPORTANTE</b>: Utenti importati devono usare le loro e-mail la password al log-in punta a cambiare le loro password nel più breve tempo possibile. </p>',
  'ningimport+log_question_added' => 'Domande Profilo aggiunto',
  'ningimport+log_skipped_users' => 'Salta membri <br /> (già esistenti)',
  'ningimport+log_title' => 'Importa risultati',
  'ningimport+log_total_added' => 'Aggiungi membri',
  'ningimport+upload_description' => '<p>Qui è possibile importare i dati utente da un sito Ning. Purtroppo, questa <b>non</b> esportare il contenuto (come foto, discussioni, video, ecc) perché Ning permette solo di esportare i dati degli utenti.</p> <p> Prima che l\'importazione è una buona idea rendere tutti consapevoli che si sta spostando. In questo modo impedire alle persone di iscriversi nel vecchio sito in modo da non fare più le importazioni. Inserire una casella di testo nella parte superiore della pagina di indice del tuo sito Ning con il seguente codice: </p> <p style="background:#f0f0f0;color:#000;font-family:courier;padding:20px;"><h1>Ci stiamo muovendo!</h1>Accedi al tuo profilo sul nostro nuovo sito:<a href="http://baksmaker.com/fulfill/">http://baksmaker.com/fulfill/</a></p> <p> Questa sarà simile a questa: </p> <div class="ow_stdmargin" style="border:1px solid #ccc;padding:20px;"> <h1>Ci stiamo muovendo!</h1> Accedi al tuo profilo sul nostro nuovo sito: <a href="http://baksmaker.com/fulfill/">http://baksmaker.com/fulfill/</a> </div> <p>Ora,</p> <p align="center" style="font-weight:bold" class="ow_highbox">Vai alla tua rete Ning -> Gestione -> Utenti -> Esporta tutti i membri dei dati (.CSV) </p> <p><b>Attenzione:</b>Prima di importare rendere pubblico il tuo network Ning. Rimuovere tutte le password di protezione e gli ospiti modalità solo, altrimenti gli avatar non saranno trasferiti!</p> <p>Vi verrà richiesto di salvare un file.Upload questo file qui e cercheremo di importare i dati utente a questo sito. Si può provare questo più volte, gli utenti duplicate non verranno creati.</p>',
